var fontResponse = {
	"version": 2,
	"d": "@font-face {\n    font-family:'nyt-franklin';\n    src:url(data:application/x-font-woff;charset=utf-8;base64,) format('woff');\n    font-weight:normal;\n    font-style:normal;\n}\n@font-face{\n    font-family:'nyt-franklin';\n    src:url(data:application/x-font-woff;charset=utf-8;base64,) format('woff');\n    font-weight:bold;\n    font-style:normal;\n}\n@font-face{\n    font-family:'nyt-cheltenham';\n    src:url(data:application/x-font-woff;charset=utf-8;base64,) format('woff');\n    font-weight:300;\n    font-style:normal;\n}\n@font-face{\n    font-family:'nyt-cheltenham';\n    src:url(data:application/x-font-woff;charset=utf-8;base64,) format('woff');\n    font-weight:normal;\n    font-style:normal;\n}\n@font-face{\n    font-family:'nyt-cheltenham';\n    src:url(data:application/x-font-woff;charset=utf-8;base64,) format('woff');\n    font-weight:bold;\n    font-style:normal;\n}\n@font-face{\n    font-family:'nyt-cheltenham';\n    src:url(data:application/x-font-woff;charset=utf-8;base64,) format('woff');\n    font-weight:bold;\n    font-style:italic;\n}"
};

(function(d,w){
	st = d.createElement("style");
	st.appendChild(d.createTextNode(fontResponse.d));
	d.getElementsByTagName("head")[0].appendChild(st);
	try {
		localStorage.setItem("fonts", JSON.stringify(fontResponse));
	} catch(e){}
})(document, window);

